import React from 'react';

const FAQ = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>FAQ</h1>
    </div>
  );
};

export default FAQ;
